import "../styles/global.css";
import Home from "./Home";

class App extends Component {
  render() {
    return (
      <div className="App">
        <Home
          userComments={this.props.userComments}
          mainVideo={this.props.mainVideo}
          sideVideo={this.props.sideVideo}
        />
        <Switch>
          <Route to="/" exact render={() => {}} />
        </Switch>
      </div>
    );
  }
}

export default App;
